                $("#pageContent .page").eq(wrapperObj.currentPage)[0].contentWindow.$("#accuracy").text(scorePercent + "%");
                $("#pageContent .page").eq(wrapperObj.currentPage)[0].contentWindow.$("#attempts").text(numOfAttempt);

